import Mock from "mockjs"
Mock.mock("/usermsg","post",function(options){
    let {username,pwd} = JSON.parse(options.body);
    if(username=="lucky"&&pwd=="123"){
        return {
            code:1,
            msg:"登录成功！"
        }
    }else{
        return {
            code:0,
            msg:"登录失败！"
        }
    }
})
